The '''Fancy Clothes Store''' is a shop in south-eastern [[Varrock]]. It is owned and run by [[Fancy dress shop owner|Asyff]]. The shop sells [[needle]]s and [[thread]] and different kinds of clothes such as [[gloves]], [[leather boots|boots]], [[cape]]s and [[hat]]s. The store is also the only place where players can obtain [[hunter gear|hunter clothing]], through the Custom Fur Clothing panel, some of which increases one's [[Thieving]] abilities or provides weight reduction.

